void displayScore(int targetsHit)
{
    //printf("Targets: " + targetsHit);
    if(targetsHit < 10)
    {
        *HEX3to0 = hexArray[targetsHit];
    }
    else if(targetsHit >= 10)
    {
        int ones = targetsHit%10;
        targetsHit/=10;
        uint16_t num = (hexArray[targetsHit]<<8) | hexArray[ones];
        *HEX3to0 = num;
        // *(HEX3to0) = hexArray[ones];
        // *(HEX3to0) = hexArray[targetsHit];
    }
}
