void setBackgroundColour(short int colour)
{
	for(int x = 0; x < 320; x++) //320 pixels wide
	{
		for(int y = 0; y < 240; y++) //240 pixels tall
		{
			plot_pixel(x, y, colour); //plot a black pixel on EVERY pixel on the screen
		}
	}
}


void drawImage(int xPos, int yPos, int width, int height, uint8_t* image)
{    
    //set up parameters
    int arrayIndex = 0; //arrayIndex accesses the colours stored in the sprite array
    short int colour; //the current colour of the pixel we are drawing

    //draw image by calling plot_pixel
    for (int x = xPos; x < xPos+width; x++) //loop through all the x until we draw as wide as speecified 
    {
        for (int y = yPos; y < yPos+height; y++) //loop through all the y until we draw as tall as speecified 
        {
            colour = (image[arrayIndex+1] << 8) | image[arrayIndex]; //create a 16bit colour by "oring" 2 colours, this the way that images are stored initally
            plot_pixel(y, x, colour); //plot what we have
            arrayIndex += 2; //go to the next colour
        }
    }
}

